import React from 'react';
import Modal from '../Modal'

const StreamDelete = () => {
    const actions=(
        <>
            <button>Delete</button>
            <button>Cancel</button>
        </>
    )
    return (
        <div>
            <Modal 
                title="Delete Stream"
                content="Are you sure you want to delete this stream"
                actions={actions}
                onDismiss
            />
        </div>
    )
}

export default StreamDelete;
